import React from 'react'
import './css/Domains.css'
import postsData from '../assets/domains.js'

function Domains() {
  const [selectedDomain, setSelectedDomain] = useState("AI in Education");

  const handleDomainChange = (domain) => {
    setSelectedDomain(domain);
  };
  return (
    <div className="domains-container">
      <div className="tabs">
        {Object.keys(domainsData).map((domain) => (
          <button
            key={domain}
            className={`tab-button ${
              selectedDomain === domain ? "active" : ""
            }`}
            onClick={() => handleDomainChange(domain)}
          >
            {domain.toUpperCase()}
          </button>
        ))}
      </div>
      <table className="domains-table">
        <thead>
          <tr>
            <th>Sr. No.</th>
            <th>Problem ID</th>
            <th>Problem Title</th>
            <th>Domain</th>
          </tr>
        </thead>
        <tbody>
          {domainsData[selectedDomain].map((item, index) => (
            <tr key={item.id}>
              <td>{index + 1}</td>
              <td>{item.id}</td>
              <td>{item.title}</td>
              <td>{selectedDomain}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  )
}

export default Domains
